import Skeleton, { SkeletonTheme } from "react-loading-skeleton";
import "../pages/movies.css";
const Smovies = () => {
  // setTimeout(function () {
  //   const imgurl = "./images/space.jpg";
  // }, 3000);
  const imgurl = "./images/space.jpg";

  return (
    <>
      <SkeletonTheme color="#202020" highlightColor="#2e302e">
        <div className="card">
          <div className="img">
            {<Skeleton height={400} />}
            <img src={imgurl || <Skeleton height={400} />} alt=""></img>
          </div>
          <h2 className="title">{"Hello" || <Skeleton height={20} />}</h2>
        </div>
      </SkeletonTheme>
    </>
  );
};

export default Smovies;
